        />
    <Text>Clam Shells? {count} </Text>
    <Button 
        title="push" 
        onPress = {() => setCount(count+1)}
        /> 
    <Text>Squats? {count} </Text>
    <Button 
        title="push" 
        onPress = {() => setCount(count+1)}
        />
    <Text>Step-Ups? {count} </Text>
    <Button 
        title="push" 
        onPress = {() => setCount(count+1)}
        />  
    <Text>Side Steps" {count} </Text>
    <Button 
        title="push" 
        onPress = {() => setCount(count+1)}
        />
    </View>
}

export default MyStack;
